    return (
      <div className={css.channels}>
        {
          this.props.channels.map((channel) =>(
            <Link href='#'>
              <a className={css.channel}>
                <img src={Channel.urls.original} alt={channel.title}/>
                <p>{channel.title}</p>
              </a>
            </Link>
          ))
        }
      </div>
    )
  }
}
